import React from "react";
import "./WorkoutComp.css";

const Workout = () => {
  const switchToWorkout = () => {
    console.log("here!");
  }

  return (
    <div className="workout">
      <div className="container" onClick={() => switchToWorkout }>
        <div className="icon">
          <i
            className="fa-solid fa-dumbbell"
            style={{ color: "#E4EAF3", fontSize: "1.5rem" }}
          />
        </div>
        <p>Workout</p>
      </div>
    </div>
  );
};

export default Workout;
